  \"2015-02-03T20:11:43.589610\",\n\t\"name\": \"building-and-safety-code-enforcement-case-80f07\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Department of Building and Safety is
  tasked with the enforcement of the City's building, electrical, mechanical and zoning
  regulations, which are elements of the Los Angeles Municipal Code. A Code Enforcement
  Case may originate from a customer service request to investigate a possible Code
  violation, from a planned and authorized inspection of a neighborhood for the purpose
  of reducing blight, or from a proactive inspection of a site due to an observed
  hazardous condition.  A case is closed (indicated by a \"C\" status) when the site
  satisfies the requirements for Code compliance, or when no Code violation is found.
  \ A case remains open (indicated by an \"O\" status) until the site satisfies the
  requirements for Code compliance.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
